INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Final Fantasy VII','Se trata de la séptima entrega de la serie Final Fantasy y la primera de la saga en presentar gráficos tridimensionales, mostrando personajes completamente renderizados sobre escenarios prerrenderizados. ','Videojuegos',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Zelda:Ocarina of Time','Es un videojuego de acción-aventura de 1998 desarrollado por la filial Nintendo EAD y publicado por Nintendo para la consola Nintendo 64','Videojuegos',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Metal Gear','Es un videojuego de infiltración diseñado por Hideo Kojima, desarrollado y publicado por Konami. Fue el título inaugural de la serie Metal Gear. ','Videojuegos',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('The Last of Us','Es un videojuego de acción-aventura y horror de supervivencia desarrollado por la compañía estadounidense Naughty Dog y distribuido por Sony Computer Entertainment para la consola PlayStation 3 en 2013.','Videojuegos',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Crash Team Racing','Es un videojuego de carreras y de Karts desarrollado por Naughty Dog, siendo el último videojuego de Crash Bandicoot hecho por esta desarrolladora, y distribuido por únicamente Sony Computer Entertainment ','Videojuegos',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Gladiator','Es una película épica del género péplum y acción del año 2000 dirigida por Ridley Scott y protagonizada por Russell Crowe, Joaquin Phoenix y Connie Nielsen.','Peliculas',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Forest Gump','Es una película estadounidense cómica dramática estrenada en 1994. Basada en la novela homónima del escritor Winston Groom, la película fue dirigida por Robert Zemeckis y protagonizada por Tom Hanks, Robin Wright, Gary Sinise y Sally Field. ','Peliculas',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Spiderman - No way Home','Es una película estadounidense de superhéroes basada en el personaje de Marvel Comics, Spider-Man, coproducida por Columbia Pictures y Marvel Studios, y distribuida por Sony Pictures Releasing. ','Peliculas',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Star wars - Una nueva Esperanza ','Es una película estadounidense de 1977 del subgénero de ciencia ficción space opera,Nota 1​2​ escrita y dirigida por George Lucas;3​ renombrada como Star Wars: Episode IV - A New Hope en 1997.','Peliculas',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('La lista de Schindler','Es una película estadounidense de 1993 del género de drama histórico basada en la novela El arca de Schindler del escritor australiano Thomas Keneally. ','Peliculas',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Funko Pop - Rey','Figura de 9 cm de Rey, la protagonista de la nueva trilogía de La guerra de las galaxias.','Merch',26,'Stock',30);
INSERT INTO productos(nombre_producto,descripcion,categoria,cantidad,estado,precio) VALUES ('Lampara Trifuerza','Usa una reliquia dorada sagrada para iluminar tu habitación, sala de juegos o estudio con la luz de la trifuerza dorada The Legend of Zelda.','Merch',26,'Stock',30);
